import React, { Component } from "react";
import { Link } from "react-router-dom";

function Home() {
    return (
        <>
        <h1>HOME</h1>
        <div c></div>
        <Link to="/month/january">JANUARY</Link>
        <Link to="/month/february">FEBRUARY</Link>
        <Link to="/month/march">MARCH</Link>
        <Link to="/month/april">APRIL</Link>

        <Link to="/month/may">MAY</Link>
        <Link to="/month/june">JUNE</Link>
        <Link to="/month/july">JULY</Link>
        <Link to="/month/august">AUGUST</Link>

        <Link to="/month/september">SEPTEMBER</Link>
        <Link to="/month/october">OCTOBER</Link>
        <Link to="/month/november">NOVEMBER</Link>
        <Link to="/month/december">DECEMBER</Link>

        </>
    );
  }

  export default Home;
